import React, { useState } from 'react';
import './Auth.css';
import Navbar from 'components/Navbars/IndexNavbar';

const Signin = () => {
  const [credentials, setCredentials] = useState({
    username: '',
    password: ''
  });
  const [rememberMe, setRememberMe] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCredentials({
      ...credentials,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setError('');
    
    if (!credentials.username || !credentials.password) {
      setError('Please enter both username and password.');
      return;
    }
    
    setIsLoading(true);
    
    // Simulate login request
    setTimeout(() => {
      setIsLoading(false);
      console.log('Login attempt:', credentials, 'Remember me:', rememberMe);
    }, 1500);
  };

  const handleSocialLogin = (provider) => {
    if (provider === 'linkedin') {
      window.location.href = 'https://www.linkedin.com/login';
    } else if (provider === 'gmail') {
      window.location.href = 'https://accounts.google.com/signin';
    }
  };

  return (
    <>
      <Navbar />
      <div className="login-page">
        <div className="login-content">
          <div className="login-left-panel">
            {/* Background image via CSS */}
          </div>

          <div className="login-right-panel">
            <div className="login-form-wrapper">
              <h3 className="login-title">Sign in to your account</h3>

              {error && <div className="error-alert">{error}</div>}

              <div className="social-login">
                <button 
                  type="button" 
                  className="social-btn linkedin"
                  onClick={() => handleSocialLogin('linkedin')}
                >
                  {/* LinkedIn Icon */}
                  <svg className="icon" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path 
                      fill="#0077B5"
                      d="M20.447 20.452h-3.554v-5.569c0-1.328-.027-3.037-1.852-3.037-1.853 0-2.136 1.445-2.136 2.939v5.667H9.351V9h3.414v1.561h.046c.477-.9 1.637-1.85 3.37-1.85 3.601 0 4.267 2.37 4.267 5.455v6.286zM5.337 7.433c-1.144 0-2.063-.926-2.063-2.065 0-1.138.92-2.063 2.063-2.063 1.14 0 2.064.925 2.064 2.063 0 1.139-.925 2.065-2.064 2.065zM6.337 20.452H3.555V9h2.782v11.452zM22.225 0H1.771C.792 0 0 .774 0 1.729v20.542C0 23.227.792 24 1.771 24h20.451C23.2 24 24 23.227 24 22.271V1.729C24 .774 23.2 0 22.222 0h.003z"
                    />
                  </svg>
                  LinkedIn
                </button>

                <button 
                  type="button" 
                  className="social-btn google"
                  onClick={() => handleSocialLogin('gmail')}
                >
                  {/* Google Icon */}
                  <svg className="icon" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path 
                      fill="#EA4335"
                      d="M12 11.8v2.7h7.6c-.3 2-2.1 5.8-7.6 5.8-4.6 0-8.4-3.8-8.4-8.5S7.4 3.3 12 3.3c2.6 0 4.3 1.1 5.3 2l3.6-3.5C18.3.5 15.4 0 12 0 5.4 0 0 5.4 0 12s5.4 12 12 12c6.9 0 11.5-4.8 11.5-11.5 0-.8-.1-1.4-.2-2.1H12z"
                    />
                  </svg>
                  Gmail
                </button>
              </div>

              <form onSubmit={handleSubmit} className="login-form">
                <input 
                  type="text" 
                  name="username" 
                  placeholder="Username"
                  value={credentials.username}
                  onChange={handleChange}
                />
                <input 
                  type="password" 
                  name="password" 
                  placeholder="Password"
                  value={credentials.password}
                  onChange={handleChange}
                />
                <div className="remember-me">
                  <input 
                    type="checkbox" 
                    id="rememberMe" 
                    checked={rememberMe} 
                    onChange={() => setRememberMe(!rememberMe)}
                  />
                  <label htmlFor="rememberMe">Remember me</label>
                </div>
                <button type="submit" className="submit-btn">
                  {isLoading ? 'Signing in...' : 'Sign In'}
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Signin;
